import React from 'react'
import styled from 'styled-components'

const Board = styled.div`
	display: flex;
	justify-content: center;
	align-item: center;
	background: red;
`

const LeaderBoard = () => {
	return (
		<Board>
			<h1>top player</h1>
		</Board>
	)
}

export default LeaderBoard
